// ListingTile.js
import React from "react";
import "../Styles/ListingTile.css";

function ListingTile({ data }) {

  const imageUrl = data.imageUrl
    ? `http://localhost:5003${data.imageUrl}`
    : "https://via.placeholder.com/150";

  return (
    <div className="ListingTile-container">
      <div className="ListingTile-img-holder">
        <img src={imageUrl} alt={data.title} className="ListingTile-img" />
      </div>
      <div className="ListingTile-description">
        <div className="ListingTile-description-text">
          <h3>{data.title}</h3>
          <p>{data.description}</p>
          <p>Price: ${data.price}</p>
          <p>Category: {data.category}</p>
          <p>Condition: {data.condition}</p>
          <p>Delivery: {data.delivery}</p>
        </div>
      </div>
    </div>
  );
}

export default ListingTile;
